import React, { Component } from "react";

class HeaderComponent extends Component {
  render() {
    return <div>
      <header class="bg-primary">
        <div class = "container ">
          
          Manga Reader
        </div>
      </header>
    </div>;
  }
}

export default HeaderComponent;
